description:
Reference quality DTS demonstration Blu-ray disc. For testing and demonstrating your surround system.
Includes more than 2 hours of great sounding pop, rock, jazz &amp; hard rock music

BDMV and Certificate folders for burning on BD-25 with Blu-Ray burner 
or for playing with for example Arcsoft Total Media Theatre or other BD PC players. 
VLC Player also plays individual tracks in BDMV/STREAM folder. 

Without any copy or regional protection. With Title Menu and Auto-Loop function for In-store demo. Cover and Disc Label for printing included.

All clips on this disc were included in their original form and unmanipulated, 
so please be aware of the volume diferences between the clips.

If you don't own an Blu-Ray burner, you can easily and very quick convert 
individual .m2ts clips (in folder BDMV-STREAM) without re-encoding to .mkv with MKVToolnix.
MKVToolnix is free software - http://www.videohelp.com/tools/MKVtoolnix
Those .mkv files are then playable from external HDD in all Blu-Ray and multimedia players 
and even on most newer TV's with DTS support (Samsung, LG &amp; Panasonic TV's - models from 2012 and up and Sony's from 2013 and up)

Audio Codecs : DTS-HD Master Audio 7.1 &amp; 5.1  &amp; DTS Surround 5.1
Video Codecs  Full HD uncompressed h.264
except tracks 11 &amp; 23 contains upscaled SD video


